import React, { Fragment } from 'react'

export default (props) => {
    const {name, phoneNumber, email} = props.person
    return (
        <div >
            <h1>{name}</h1>
            <span>{phoneNumber}</span>
            <br/>
            <span>{email}</span>
        </div>
    )
}
